import { createRouter, createWebHistory } from "vue-router";
import MapWindow from "../src/components/MapWindow.vue"; // 假设您有三个页面组件 Page1, Page2, Page3
import Data_Sheet from "../src/components/Data_Sheet.vue";
import UserWindow from "../src/components/UserWindow.vue";
import EnrollWindow from "@/components/EnrollWindow.vue";

const routes = [
  { path: "/", component: MapWindow },
  { path: "/data", component: Data_Sheet },
  { path: "/user", component: UserWindow },
  { path: "/EnrollWindow", component: EnrollWindow },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
